      "io.k8s.api.node.v1.Scheduling": {
        "description": "Scheduling specifies the scheduling constraints for nodes supporting a RuntimeClass.",
        "properties": {
          "nodeSelector": {
            "additionalProperties": {
              "default": "",
              "type": "string"
